      alert("sucessfully inserted")
    });
  };


  const submitReview1 = () => {
    Axios.post("http://localhost:3001/api", {
      resumeid: resumeid,
    }).then((response) => {
      console.log(response);
    })


    
    
  };
  useEffect(()=>{
    Axios.get(`http://localhost:3001/api/`).then((data)=>{
        console.log(data)
    setPost({
             id1: data.data[0].id,
             usn: data.data[0].usn,
             name1: data.data[0].name,
            });
     });
    
    },[postId]);



return (
    <div class="context">
      <div class="area">
        <div >
        </div>
        <div class="area">
          <ul class="circles">
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
